import React from "react";
import FishCard from "./FishCard";

function FishList({setPlants, plants, search}) {
  return (
    <ul className="cards">{plants.filter(plant => plant.name.toLowerCase().includes(search.toLowerCase()))
      .map(plant => <FishCard 
      key={plant.id}
      plant={plant}
      setPlants={setPlants}
      />)}</ul>
  );
}

export default FishList;
